import React from "react";
import batchDetails from "./batchDetails";

function Batches() {
  return (
    <div className="batches">

        <h5 className="title-left">Batches</h5>

      <p className="title-right">Create Batch   <i className="fa fa-plus-square" aria-hidden="true" onClick={() => console.log("Clicked create Batch.")}></i></p>
    </div>
  );
}

export default Batches;
